const TableComponent = ({ data }) => {
    // 保持空表格结构，但没有内容
    return (
        <table>
            <thead>
                <tr>
                    <th>Column 1</th>
                    <th>Column 2</th>
                    {/* 可以根据需要添加更多的列头 */}
                </tr>
            </thead>
            <tbody>
                {/* 表格体内容为空，保持空白 */}
                {data.length === 0 ? (
                    <tr>
                        <td colSpan="2"></td> {/* 确保占据两列，表格保持空白 */}
                    </tr>
                ) : (
                    data.map((row, index) => (
                        <tr key={index}>
                            <td>{row.column1}</td>
                            <td>{row.column2}</td>
                            {/* 更多列数据... */}
                        </tr>
                    ))
                )}
            </tbody>
        </table>
    );
};

export default TableComponent;
